/*Table structure for table `kritik_saran` */

DROP TABLE IF EXISTS `kritik_saran`;

CREATE TABLE `kritik_saran` (
  `ID_PEMBELI` varchar(20) NOT NULL,
  `KRITIK` varchar(200) DEFAULT NULL,
  `SARAN` varchar(200) DEFAULT NULL,
  `delete` tinyint(1) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `kritik_saran` */

insert  into `kritik_saran`(`ID_PEMBELI`,`KRITIK`,`SARAN`,`delete`) values 
